import React from "react";


export default function Card({image, name, temperaments}){
   return (
    <div>
        <img src={image} alt='not found'/>
    </div>,
    <div>
        <h2>{name}</h2>
    </div>,
    <div>
        {temperaments?.map(el =>{
            return (
                <h6>{el.name}</h6>
            )
        })}
    </div>
   )
}
